import React from "react";
import Home from "./Home"; 
import About from "./About";
import Contact from "./Contact";
import Projects from "./Projects";
import Sticky from "react-stickynode";
import { motion, AnimatePresence } from "framer-motion";
import "../styles.css"
import { AppBar, Toolbar, CssBaseline, Typography, useTheme, useMediaQuery} from "@mui/material";
import { makeStyles } from "@mui/styles";
import DrawerComponent from "../components/drawercomponent";
import { Link } from "react-router-dom";

export default function Navbar() {
  const [open, setOpen] = useState(false);
  const [act, setAct] = useState(undefined);
  return (
    <RootStyle>
      <DashboardNavbar onOpenSidebar={() => setOpen(true)} act={act} darkMode={darkMode} setDarkMode={setDarkMode} />
      <DashboardSidebar isOpenSidebar={open} onCloseSidebar={() => setOpen(false)} act={act} />
      <MainStyle>
        <Outlet context={{ act, darkMode }} />
      </MainStyle>
    </RootStyle> 
  );

}
